License Identifier, being a globally unique identifier for a license or contract under which items are generated, submitted for processing and/or paid for, that is constructed by concatenating:
 - an ISO/IEC 15459 issuing agency code;
 - a license or contract number which accords with specifications of the issuing agency concerned;
 and that:
 - comprises only upper case alphabetic and/or numeric characters;
 - is unique (that is, is distinct from any other ISO/IEC 15459 compliant identifier) within the domain of the issuing agency6;
 - cannot be derived from any other ISO/IEC 15459 compliant identifier, issued under the same issuing agency, by the simple addition of characters to, or their removal from, its end.

FAO fishing area code as defined by the Fisheries and Aquaculture Department of the FAO (http://www.fao.org. Search for Fishing Area Code sub-site).
All characters of the GS1 General Specification-defined subset of ISO/IEC 646 are allowed.
Examples:
18L37.1.3 Western Mediterranean Sea, Sardinia;
18L47.B.1 Atlantic, Southeast, SEAFO Division, Namibia EEZ;
18L67 Pacific, Northeast.

'26L' Location Code, being a code identifying a location or geographic area, or an associated group of such locations or areas, that has relevance to a related transaction and that complies with one or the structures defined in (a) to (f) below:
a) two upper case alphabetic character corresponding to the ISO 3166-1 two alpha country code of the country in which, or consisting of which, the location(s) or area(s) are situated;
b) three upper case alphabetic characters corresponding to the IATA code of the airport or city in, close to, or consisting of which the location(s) or area(s) are situated;
c) four or more characters of which the first three correspond to an ISO 3166-1 country code followed by a dash (-), with the balance being a postcode in the country concerned;
d) four or more characters of which the first three correspond to an ISO 3166-1 country code followed by a dot (.), with the balance being an ISO 3166-2 country subdivision code in the country concerned;
e) five upper case alphabetic characters corresponding to the UN/LOCODE of the area in, close to, or consisting of which, the location(s) or area(s) are situated;
f) the concatenation, being not less than seven or more than 35 characters in length, of:
- an ISO/IEC 15459 issuing agency code;
- a location code, consisting of characters drawn from the set {A-Z; 0-9} which accords with specifications of the issuing agency concerned.

