Aquatic Sciences and Fisheries Information System (ASFIS) 'Inter-agency 3-alpha species code', maintained by the Food and Agriculture Organisation of the United Nations (www.fao.org, then search for 'ASFIS').
Examples;
7RMUC = Mud carp;
7RPCD = Australian freshwater herring;
7RWSH = Great white shark.

Food and Agricultural Organisation (FAO) International Standard Classification of Fishing Gears (ISSCFG) code. (www.fao.org)
All characters of the GS1 General Specification-defined subset of ISO/IEC 646 are allowed.
Examples:
8R02.1.0 = Beach seines;
8R03.1.5 = Shrimp trawls;
8R05.1.0 = Portable lift net.

Production method for fish and seafood as specified by the Fisheries and Aquaculture Department of the Food and Agricultural Organisation (FAO) of the United Nations, according to EU Regulation 1379/2013. (www.fao.org).
All characters of the GS1 General Specification-defined subset of ISO/IEC 646 are allowed.
Examples;
9R01 = Caught at sea;
9R02 = Caught in fresh water;
9R03 = Farmed.

Equipment Identifier, being a globally unique identifier for a device, an item of equipment or instance of a computer application used in the production, transport, processing or other handling of items, that is constructed by concatenating:
 - an ISO/IEC 15459 issuing agency code;
 - an equipment number which accords with specifications of the issuing agency concerned; and that:
 - comprises only upper case alphabetic and/or numeric characters;
 - is unique (that is, is distinct from any other ISO/IEC 15459 compliant identifier) within the domain of the issuing agency;
 - cannot be from any other ISO/IEC 15459 compliant identifier, issued under the same issuing agency, by the simple addition of characters to, or their removal from, it end.
Reader ID.
Equipment identifier, being a globally unique identifier for a device, an item of equipment or instance of a computer application used in the production, transport, processing or other handling of items.

UPU Location Code, being a code identifying a location or geographic area, or an associated group of such locations or areas, that has relevance to a related transaction and that complies with one of the structures defined in a) to g) below:
a) two upper case alphabetic characters corresponding to the ISO 3166-1 two alpha country code of the country in which, or consisting of which, the location(s) or area(s) are situated;
b) three upper case alphabetic characters corresponding to the IATA code of the airport or city in, close to, or consisting of which the location(s) or area(s) are situated;
c) four or more characters of which the first three correspond to an ISO 3166-1 country code followed by a dash (-), with the balance being a postcode in the country concerned;
d) four or more characters of which the first three correspond to an ISO 3166-1 country code followed by a dot (.), with the balance being an ISO 3166-2 country subdivision code in the country concerned;
e) five upper case alphabetic characters corresponding to the UN/LOCODE of the area in, close to, or consisting of which, the location(s) or area(s) are situated;
f) six upper case alphanumeric characters corresponding to a UPU IMPC code allocated in accordance with UPU standard S34;
g) the concatenation, being not less than seven nor more than 25 characters in length, of:
 - an issuer code allocated in accordance with UPU standards S31;
 - a location code, consisting of characters drawn from the set {A-Z; 0-9} which accords with specifications of the issuer concerned.

License Plate with Service Data and Location Code is a compound data construct, compliant with the specification in UPU standard S25, which includes specification of:
 - an ISO/IEC 15459-compliant item identifier;
 - a data identifier 5U compliant specification of the service to be provided in respect of the item;
 - a data identifier 17U compliant UPU location code or a data identifier 18U compliant qualified UPU location code.
 Note - For further details, please refer to UPU standard S25. The distinction between a simple UPU location code (DI 17U) and a qualified UPU location code (DI 18U) can be determined from the first character. If this is numeric, 18U applies; if it is alphabetic, 17U applies.

Event, Date, And Time.
ISO format YYYYMMDDHHMM (24 hour clock - UTC) immediately followed by a UN/EDIFACT Code Qualifier 2005 providing a code specifying type of date), e.g.,
11 [Date when goods are expected to be dispatched/shipped message is issued.];
17 [Estimated delivery date/time when goods are expected to be delivered];
35 [Date on which goods are delivered to their destination.];
118 [Booking Confirmed];
