132 [Date/time when the carrier estimates that a means of transport should arrive at the port of discharge or place of destination.];
133 [Date/time when carrier estimates that a means of transport should depart at the place of departure];
137 [Date/time when the supplier ships parts based on the customer's request. (Date when DESADV message is issued. Recommendation is the DESADV is issued within 30 minutes of goods being picked up at ShipFrom party];
146 [Estimated Entry date (Customs) date on which the official date of a Customs Entry is anticipated.];
151 [Import Date (Arrived at port with intent to unlade];
186 Departs a Facility ('Gate-out)];
204 [Date on which Customs releases merchandise to the carrier or importer];
253 [Departs from a Port ('Vessel Departure')];
