Date, represented in modified UTC compliant form:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] where square brackets indicate optionality and yyyy is the year, mmdd the month and day, hhmmss the time of day in hours minutes and seconds, fff the fractions of sections and poooo the offset from UTC expressed in hours and minutes, the offset being positive if p is a point (.), negative if P is a minus sign (-).
EXAMPLE:
2005 - (UTC) calendar year 2005;
200505 - (UTC) calendar month May 2005;
20050518 - (UTC) 18 May 2005;
200505181247 - 12:47 UTC on 18 May 2005;
200505181247.0100 - 12:47 local time, being 11:47 UTC, on 18 May 2005;
20050518124723099 - 99 milliseconds after UTC 12:47:23 on 18 May 200.

Qualified Date, comprising the concatenation of:
- an ISO/IEC 15459 issuing agency code;
- a date qualifier conforming to the specifications of that issuing agency;
- a date whose format and interpretation comply with the specifications of the issuing agency for that date qualifier.

Declaration of Packaging Material Category*, Code* and Weight for a given packaging material used in a given packaging according to the EU packaging and packaging waste directive. (Material category and code defined in Annex M).
12ECCMMMMMMNNNNNUU where: - '12E' (an3) is the Data Identifier;
 - 'CC' (n2) is the Material Category per Annex M;
 - 'MMMMMM' (an1...6) is the Material Code per Annex M;
 - 'NNNNN' (n5) Material Weight, including decimal point (e.g., 12.12);
 - 'UU' (an2) is the Unit of measure for weight (e.g., KG, GR, LB or OZ per ANSI X12.3 as in Annex D).

Name of Party.
Name of a party followed by a plus (+) character followed by one or more code values from EDIFACT Code List 3035 'Party Qualifier', e.g.;
BY [Buyer];
CF [Container operator];
CN [Consignee];
CS [Consolidator];
DEI [Vessel operator/captain of vessel];
FA [Operational staff code];
IM [Importer];
MF [Manufacturer];
OS [Shipper];
SE [Seller];
ST [Ship To];
UC [Ultimate consignee].

Consignee Number.
The unique identifying number can be the IRS, EIN, SSN, or the CBP assigned number, as required on the Security Filing. Only the following formats shall be used: IRS EIN: NN-NNNNNNN;
IRS EIN w/ suffix:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
CBP assigned nbr: YYDDPP-NNNNN.
